import React, { Component } from "react";
class SharethisComponent extends Component {
  constructor(props) {
    super(props);
    this.state = {
      url: this.props.url,
    };
    this.apiUrl = "https://pageviews.artefaktas.eu/api";
  }

  componentDidMount() {
    const customInit = {
      headers: {
        "User-Agent": "artefaktasbot",
        passedUrl: this.apiUrl,
      },
    };
    async function getData() {
      const res = await fetch(this.apiUrl, customInit);
      const parsed = await res.json();
      return parsed;
    }
    getData().then((data) => {
      console.log(data);
    });
  }

  render() {
    return <div>{this.state.url}</div>;
  }
}

export default SharethisComponent;
